window.bookSummaryJSON = "<p><b>Will my magic save the realm... or drive me into madness?</b><br> <br> In the wake of an uprising of illicit sorcery, my men and I find ourselves on the runâ€”determined to clear our names by protecting the kingdom.<br> <br> But to face off against the psychopaths who want to remake our country into a realm of chaos and brutality, I'll need to tap into my wild magic. And the god who's watched over me expects me to stand on my own now.<br> <br> If I can't overcome the odds against us, the lives of the men I love are forfeit. But how far can I go without becoming what I've feared most?<br> <br> *<i>Secrets of Graves and Gold</i> is the third book in a new fantasy romance series full of forbidden magic, impossible love, hot damaged men, and a rebellious heroine who's so much more than she imagines. There is one more book to come.*</p>"; 
